              <Link to={"/products"} className="item">
                Products
              </Link>
            </li>
            <li className="nav-item">
              <Link to={"/add"} className="item">
                Add
              </Link>
            </li>
          </div>
        </nav>

        {/* <div className="container mt-3">
          <Switch>
            <Route exact path={["/", "/products"]} component={ProductsList} />
